export default function ProjectsPage() {
    return (
        <Iframe url="ttp://www.youtube.com/embed/xDMP3i36naA"
                width="450px"
                height="450px"
                id="myId"
                className="myClassname"
                display="initial"
                position="relative"/>
    );
}
